import * as React from "react";
import { Redirect } from 'react-router-dom';
import gql from "graphql-tag";
import { useQuery, useMutation, useLazyQuery, useApolloClient } from "@apollo/react-hooks";
import axios from "axios";
// GraphQL 
const GET_COMPANY_SETTINGS_BY_ID = gql`
  query getCompanyById($CompanyId: ID!, $PopulateInput:PopulateInput!) {
    getCompanyById(CompanyId:$CompanyId, PopulateInput:$PopulateInput) {
      _id
      name
      url
      language
      signupMode
      avatar
      _owner {
        _id
      }
      inviteEmails {
        _id
        email
        accepted
      }
    }
  }
`;
const UPDATE_COMPANY_BY_ID = gql`
  mutation updateCompanyById($CompanyId: ID!, $CompanyInput: CompanyInput!) {
    updateCompanyById(CompanyId:$CompanyId, CompanyInput:$CompanyInput)
  }
`;
const S3_GENERATE_URL = gql`
  mutation s3GenerateUrl($Key: String, $ContentType: String) {
    s3GenerateUrl(Key:$Key, ContentType:$ContentType) {
      url
      name
      fileType
    }
  }
`;

//
// Function
//

const CompanySettings: React.FunctionComponent<{}> = () => {
  // Set States
  const [companySettings, setCompanySettings] = React.useState(null);
  const [uploadFile, setUploadFile] = React.useState(null);
  // GraphQL - Q's
  const [ callCompanySettingsById, { loading, data, error }] = useLazyQuery(GET_COMPANY_SETTINGS_BY_ID, {
    fetchPolicy: "no-cache"
  });
  // GraphQL - M's
  const [ updateCompany, { loading:companyUpateLoading, error:companyUpateError }] = useMutation(UPDATE_COMPANY_BY_ID);
  const [ s3GenerateUrl, { loading:s3GenerateUrlLoading, error:s3GenerateUrlError }] = useMutation(S3_GENERATE_URL);

  //
  // Use Effect
  //

  React.useEffect(() => {
    if(error && !loading) {
      console.log(`Error ${error}`);
    } else {
      if(!data) {
        callCompanySettingsById({
          variables:{
            "CompanyId": "5ddd3993dae01149faf416ff",
            "PopulateInput": {
              "key": "_owner",
              "skip": 0,
              "limit": 2
            }
          }
        });
      } else {
        console.log(data.getCompanyById);
        setCompanySettings(data.getCompanyById);
      } 
    }
  },[loading, data, error]); 

  //
  // OnChange
  //

  const onChange = (event) => {
    let newData = {...companySettings}; 
    newData[event.target.name] = event.target.value; 
    setCompanySettings(newData);
  }

  // 
  // Get Image
  //

  const getImage = (e) => {
    const files = e.target.files;
    if (files && files.length > 0) {
      const file = files[0];
      setUploadFile({ file });
    }
  };

  //
  // Upload Avatar
  //

  const uploadAvatar = async (event) => {
    event.preventDefault();
    const { file } = uploadFile;
    try {
        const ext = file.name.slice((file.name.lastIndexOf(".") - 1 >>> 0) + 2);
        const name = Math.floor(Date.now() / 1000);
        const res = await s3GenerateUrl({
            variables: {
                Key: name+'.'+ext,
                ContentType: file.type
            }
        });       
        if(res.data.s3GenerateUrl) {                               
          const aws = await axios.put(res.data.s3GenerateUrl.url, file, {
              headers: { 'Content-Type':res.data.s3GenerateUrl.fileType, 'x-amz-acl': 'public-read' }
          } )
          if(await aws) {
            if(aws.status === 200) {
                const res = await updateCompany({
                    variables: {
                        CompanyId:companySettings._id,
                        CompanyInput: { avatar:name+'.'+ext }
                    }
                });
                if(await res.data.updateCompanyById) {
                  console.log("Company has been updated!");
                } 
            } else {
                console.log('Error has occured');
            }                 
          }
        }
    } catch(err) {
      console.log(`Error (`+err+`)`);
    }
  }

  //
  // Transfer Company Ownership - Sunday
  //

  const transferCompanyOwnership = async () => {
    event.preventDefault();
  }


  //
  // Add User As Admin - Sunday
  //

  const addUserAdmin = async () => {
    event.preventDefault();
  }

  //
  // Remove User As Admin - Sunday
  //

  const removeUserAdmin = async () => {
    event.preventDefault();
  }

  //
  // Send Email Invite - Sunday
  //

  const sendEmailInvite = async () => {
    event.preventDefault();
  }

  //
  // Send Email Invite Reminder - Sunday
  //

  const sendEmailInviteReminder = async () => {
    event.preventDefault();
  }

  //
  // Submit Company Update
  //

  const submitCompanyUpdate = async () => {
    event.preventDefault();
    try {
        const res = await updateCompany({
            variables: {
              CompanyId:companySettings._id,
              CompanyInput: {
                "name":companySettings.name,
                "url":companySettings.url,
                "signupMode":companySettings.signupMode,
                "language":companySettings.language
              }
            }
        });
        if(await res.data.updateCompanyById) {
          console.log("User has been updated!");
        } else {
          console.log(res)
        }
    } catch(err) {
      console.log(`Error (`+err+`)`);
    }
  }

  const test = async () => {
    event.preventDefault();
  }

  // Return
  return (
    <>      
      {loading && <p>Loading Company Settings...</p>}   
      {companySettings && 
        <>
          <h3>Upload Avatar</h3>
          <input
              id='upload-company-avatar-image'
              type='file'
              accept='image/*'
              onChange={getImage}
          />
          <form onSubmit={uploadAvatar}>
              <button id="company-upload-button">Upload</button>
          </form>
          <br/><br/>
        </>
      }
      {companySettings && 
        <form onSubmit={submitCompanyUpdate}>
          <input type="text" onChange={(event) => onChange(event)}  name="name" placeholder="Name" value={companySettings.name || ""}/><br/>
          <input type="text" onChange={(event) => onChange(event)}  name="url" placeholder="Url" value={companySettings.url || ""}/><br/>
          <div className="select-group">
            <div className={`base-class ${companySettings.signupMode == 'invite' ? 'is-active' : ''}`} onClick={test}>Invite</div>
            <div className={`base-class ${companySettings.signupMode == 'email' ? 'is-active' : ''}`} onClick={test}>Email</div>
          </div>
          {companyUpateLoading && <p>Updating Company...</p>}
          <button>Update Company</button>
        </form>
      }
    </>
  );
};

export default CompanySettings
